import React from 'react';
import logo from './logo.jpg';
import './App.scss';
import Buttons from './Buttons/Buttons';

function App() {
  return (
    <div className="App">
          <div className="img-div">
            <img src={logo} className="logo" alt="logo" />
          </div>
            <Buttons></Buttons>

    </div>
  );
}

export default App;
